import SecondaryHeading from "../../UI/SecondaryHeading";
import Container from "../../UI/Container";
import "./Featured.css";

const Featured = () => {
  const sectionTitle = "Featured";
  const html = (
    <div className="product-card">
      <div className="product-img">
      <img src="./imgs/products/product-1.png" />
      </div>
      <div className="product-description">
        <p className="product-title">
          Pueraria Mirifica And Study Phyto Estrogens
        </p>
        <p className="product-price">$599.00</p>
      </div>
    </div>
  );

  return (
    <div className="featured">
      <Container>
        <SecondaryHeading content={sectionTitle} />
        <div className="featured-products">
          {[1, 1, 1, 1, 1, 1, 1, 1].map((i) => html)}
        </div>
      </Container>
    </div>
  );
};

export default Featured;
